    <div style="display: flex; justify-content: center; flex-direction: column; align-items: center;">
    <div
      v-if="showTooltip && selectedCity"
      :style="tooltipStyle"
      class="tooltip"
    >
      {{ selectedCity.name }}

    </div>
    <button
      v-if="showTooltip && selectedCity"
      @click="buildRoute"
      style="margin-top: 8px;
    padding: 6px 12px;
    cursor: pointer;
    border: none;
    border-radius: 7px;
    background: #e72d50;
    color: white;
}"
    >
      Проложить маршрут
    </button>
