</template>

<script lang="ts" setup>
import { ref, computed } from 'vue'

const cities = [
  { name: 'Казань', cx: 345, cy: 230 },
  { name: 'Набережные Челны', cx: 770, cy: 270 },
  { name: 'Нижнекамск', cx: 650, cy: 330 },
  { name: 'Елабуга', cx: 700, cy: 230 },
  { name: 'Альметьевск', cx: 740, cy: 430 },
  { name: 'Лениногорск', cx: 750, cy: 530 },
]

const showTooltip = ref(false)
const selectedCity = ref<{ name: string; cx: number; cy: number } | null>(null)

// Функция выбора города и показа тултипа
function selectCity(city: { name: string; cx: number; cy: number }) {
  selectedCity.value = city
  showTooltip.value = true
}

// Стиль тултипа
const tooltipStyle = computed(() => {
  if (!selectedCity.value) return {}

  return {
    background: 'rgb(13 114 185)',
    color: '#fff',
    padding: '4px 8px',
    borderRadius: '4px',
    boxShadow: '0 2px 8px rgba(0,0,0,0.2)',
    fontSize: '14px',
    whiteSpace: 'nowrap',
   
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '30px',
    fontWeight: '600',
  }
})

// Функция для открытия Яндекс.Карт с маршрутом до выбранного города
function buildRoute() {
  if (!selectedCity.value) return

  // Например, начальная точка — Москва (можно заменить на реальную текущую позицию)
  const start = encodeURIComponent('')
  const end = encodeURIComponent(selectedCity.value.name)

  const url = `https://yandex.ru/maps/?rtext=${start}~${end}&rtm=car`

  window.open(url, '_blank')
}
</script>


